ALTER TABLE "public"."historical_order"
ADD COLUMN "patient_id" int8;

ALTER TABLE "public"."historical_order"
ADD CONSTRAINT "historical_order_patient_id_fk" FOREIGN KEY ("patient_id") REFERENCES "public"."emr_patient_info" ("rid");

UPDATE historical_order ho
SET patient_id = (
	SELECT
		P .rid
	FROM
		emr_patient_info P
	WHERE
		P .file_number = ho.patient_file_no
	AND P .tenant_id = 1
)
WHERE
	ho.tenant_id = 1;
	
--TODO: set not-null for patient_id on historical_order
ALTER TABLE "public"."historical_order"
ADD CONSTRAINT "order_no_tenant_branch_uk" UNIQUE ("branch_id", "tenant_id", "order_number");

UPDATE historical_order ho
SET order_number = concat (
	(
		SELECT
			code
		FROM
			lab_branch
		WHERE
			rid = 2
	),
	'-',
	ho.order_number
)
WHERE
	ho.tenant_id = 1;

