UPDATE historical_order ho
SET patient_file_no = concat (
	(
		SELECT
			code
		FROM
			lab_branch
		WHERE
			rid = 2
	),
	'-',
	ho.patient_file_no
)
WHERE
	ho.tenant_id = 1;
	
